/* Procedure structure for procedure `createemployee` */

/*!50003 DROP PROCEDURE IF EXISTS  `createemployee` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `createemployee`(in EmployeeName text)
BEGIN
	select * from employee where EmpName=EmployeeName;
	END */$$
DELIMITER ;

/* Procedure structure for procedure `createmployee` */

/*!50003 DROP PROCEDURE IF EXISTS  `createmployee` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `createmployee`(in EmployeeName text)
BEGIN
	insert into employee (EmpName) values (EmployeeName);
	END */$$
DELIMITER ;

